  false,\n\t\"url\": null,\n\t\"notes\": \"The Midwater Assessment and Conservation
  Engineering (MACE) program of NOAA National Marine Fisheries Service (NMFS), Alaska
  Fisheries Science Center (AFSC) conducted acoustic-trawl (AT) stock assessment surveys
  in the Bogoslof Island area of the southeastern Aleutian Basin during the winter
  of 2012 to estimate the distribution and abundance of walleye pollock (Theraga chalcogramma).
  The surveys were conducted 5-15 March, departing from Kodiak, Alaska (4 March) and
  returning to Kodiak at the end of cruise DY1203 on 27 March; an intermediate personnel
  transfer was conducted in Kodiak on 19 March. The surveys were conducted aboard
  NOAA Ship Oscar Dyson, a 64 meter stern trawler equipped with acoustic and oceanographic
  instrumentation.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
